public boolean retainAll(Collection<?> c) {
  boolean modified = false;
  Iterator<E> it = iterator();
  while (it.hasNext()) {
    if (!c.contains(it.next())) {
      it.remove();
      modified = true;
    }
  }
  return modified;
}
